import React from 'react';
import FormGroup from '@material-ui/core/FormGroup';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import Switch from '@material-ui/core/Switch';





export default function SwitchLabels(props) {
  const handleChange = name => event => {
    setState({ ...props, [name]: event.target.checked });
  };
  return (
    <FormGroup row>
      <FormControlLabel
        control={
          <Switch checked={props.checkedEasy}  value="checkedEasy" />
        }
        label="Easy Game"
      />
      <FormControlLabel
        control={
          <Switch
            checked={props.checkedMedium}
            value="checkedMedium"
            color="primary"
          />
        }
        label="Medium"
      />
    </FormGroup>
  );
}
